Theo thứ tự chuẩn của các phép tính, phép chia xảy ra trước phép trừ. Chúng tôi thấy rằng câu trả lời của chúng tôi là \begin{align*}
8-4 \div 2 - 1 &= 8-2-1 \\
&= 6-1 \\
&= \đóng hộp{5}.
\end{căn chỉnh*}

Chúng tôi lấy điểm trung bình của sáu điểm sau: \begin{align*}
\frac{70 + 80 + 90 + 75 + 80 + 85}{6} &= \frac{(70 + 90) + 80 + 80 + (75 + 85)}{6}\\
&= \frac{(80 + 80) + 80 + 80 + (80 + 80)}{6}\\
&= \frac{6\cdot 80}{6}\\
&= \đóng hộp{80}.
\end{căn chỉnh*}

Thay vì thực hiện từng phép chia riêng biệt rồi cộng lại, hãy nhớ rằng $x\div d + y\div d = (x+y)\div d $ nếu $d$ khác 0. Sử dụng thực tế này, chúng ta có thể tính toán như sau: \begin{align*}
49{,}994\div 7 + 20{,}006\div 7 &= (49{,}994 + 20{,}006) \div 7\\
&= 70{,}000\div 7\\
&=\đóng hộp{10{,}000}.
\end{căn chỉnh*}

