Khi giải bài toán này chúng ta phải nhớ áp dụng thứ tự thực hiện các phép tính. Đầu tiên, chúng ta thực hiện tất cả các trường hợp nhân và chia từ trái sang phải để thu được

\bắt đầu{căn chỉnh*}
1+6\cdot2-3+5\cdot4\div2&=1+12-3+5\cdot4\div2\\
&=1+12-3+20\div 2\\
&=1+12-3+10.
\end{align*}Tiếp theo, chúng ta thực hiện tất cả các phép cộng và trừ bắt buộc từ trái sang phải. Chúng tôi nhận được \begin{align*}
1+12-3+10&=13-3+10\\
&=10+10\\
&=\được đóng hộp{20}.
\end{căn chỉnh*}

Có 5 số trong tập hợp này nên ta có \begin{align*}
\frac{6+13+18+4+x}{5}&=10 \\
6+13+18+4+x&=50 \\
6+4+13+18+x&=50 \\
10+31+x &=50 \\
41+x&=50 \\
x &= \đóng hộp{9}
\end{căn chỉnh*}
